import React from 'react';
import { View, Text, TouchableOpacity, StyleSheet } from 'react-native';
import Fonts from '../Utils/Stylesheet';

const Auctions = () => {
    return (
        <View style={styles.container}>
            <View style={styles.header}>
                <Text style={Fonts.titleLarge}>Auktionen</Text>
            </View>
            <View style={styles.topBar}>
                <View style={styles.buttonsContainer}>
                    {["Allgemein", "Bieten", "Kaufaufträge", "Exponate", "Anforderungen"].map((button, index) => (
                        <TouchableOpacity key={index} style={styles.button}>
                            <Text style={Fonts.textButton}>{button}</Text>
                        </TouchableOpacity>
                    ))}
                </View>
                <View style={styles.infoContainer}>
                    <Text style={Fonts.textButton}>Informationen</Text>
                </View>
            </View>
            <View style={styles.mainContent}></View>
        </View>
    );
};

const styles = StyleSheet.create({
    container: { flex: 1, backgroundColor: '#fff', padding: 20 },
    header: { marginBottom: 20 },
    topBar: { flexDirection: 'row', height: 50 },
    buttonsContainer: { flex: 3, flexDirection: 'row', alignItems: 'center', backgroundColor: 'rgb(247,203,105)' },
    button: { flex: 1, justifyContent: 'center', alignItems: 'center' },
    infoContainer: { flex: 1, justifyContent: 'center', alignItems: 'center', backgroundColor: 'rgb(247,203,105)' },
    mainContent: { flex: 1, backgroundColor: 'rgb(253,241,219)' },
});

export default Auctions;
